import Banner from '../../components/UI/Banner'
const WhyChooseUs = () => {
    return (
        <>
            <Header Page={'whychooseus'} />
            <main>
                {/*BANNER */}
                <Banner />
                {/*/.END BANNER*/}

                {/*Definition */}
                <Definition />
                {/*/.END Definition*/}

                {/* Reasons */}
                <Reasons />
                {/* End Reasons */}

                {/* Benefits */}
                <Benefits />
                {/* End Benefits */}

                {/* Projects */}
                <Projects />
                {/* End Projects */}
            </main>
        </>
    )
}

export default WhyChooseUs;
